import React from "react";
import editIcon from "../images/editIcon.png";
import deleteIcon from "../images/deleteIcon.png";
import shareIcon from "../images/shareIcon.png";

function Analytics() {
  return (
    <div>
      <p
        style={{
          color: "#5076FF",
          fontWeight: "600",
          fontSize: "2.5em",
          textAlign: "center",
          marginTop: "10vh",
        }}
      >
        Quiz Analysis
      </p>

      <p
        style={{
          width: "72vw",
          marginLeft: "4vw",
          marginRight: "4vw",
          color: "#FFFFFF",
          backgroundColor: "#5076FF",
          marginTop: "8vh",
          borderRadius: "10px",
          fontSize: "1.1em",
          paddingTop: "1.5vh",
          paddingBottom: "1.5vh",
          fontWeight: "600",
        }}
      >
        <span
          style={{
            marginLeft: "1.5vw",
            width: "5vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          S.No
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Quiz Name{" "}
        </span>
        <span
          style={{
            width: "14vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Created on
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Impression
        </span>
      </p>

      <p
        style={{
          width: "72vw",
          marginLeft: "4vw",
          marginRight: "4vw",
          color: "#000000",
          borderRadius: "10px",
          fontSize: "1.1em",
          paddingTop: "1vh",
          paddingBottom: "1.2vh",
          fontWeight: "600",
        }}
      >
        <span
          style={{
            marginLeft: "1.5vw",
            width: "5vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          1
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Quiz 1
        </span>
        <span
          style={{
            width: "14vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          01 Sep, 2023
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          345
        </span>
        <span
          style={{
            marginLeft: "1vw",
            width: "7vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          <img src={editIcon} alt="editIcon" />
          <span style={{ marginLeft: "0.5vw" }}>
            <img src={deleteIcon} alt="editIcon" />
          </span>
          <span style={{ marginLeft: "0.2vw" }}>
            <img src={shareIcon} alt="editIcon" />
          </span>
        </span>
        <span
          style={{
            width: "14vw",
            textAlign: "center",
            display: "inline-block",
            marginLeft: "1vw",
            textDecoration: "underline",
          }}
        >
          Question Wise Analysis
        </span>
      </p>

      <p
        style={{
          width: "71.8vw",
          marginLeft: "4vw",
          marginRight: "4vw",
          color: "#000000",
          backgroundColor: "#B3C4FF",
          borderRadius: "10px",
          fontSize: "1.1em",
          paddingTop: "1vh",
          paddingBottom: "1.2vh",
          fontWeight: "600",
        }}
      >
        <span
          style={{
            marginLeft: "1.5vw",
            width: "5vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          2
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Quiz 2
        </span>
        <span
          style={{
            width: "14vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          04 Sep, 2023
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          2000
        </span>
        <span
          style={{
            marginLeft: "1vw",
            width: "7vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          <img src={editIcon} alt="editIcon" />
          <span style={{ marginLeft: "0.5vw" }}>
            <img src={deleteIcon} alt="deleteIcon" />
          </span>
          <span style={{ marginLeft: "0.2vw" }}>
            <img src={shareIcon} alt="shareIcon" />
          </span>
        </span>
        <span
          style={{
            width: "14vw",
            textAlign: "center",
            display: "inline-block",
            marginLeft: "1vw",
            textDecoration: "underline",
          }}
        >
          Question Wise Analysis
        </span>
      </p>

      <p
        style={{
          width: "71vw",
          marginLeft: "4vw",
          marginRight: "4vw",
          color: "#000000",
          borderRadius: "10px",
          fontSize: "1.1em",
          paddingTop: "1vh",
          paddingBottom: "1.2vh",
          fontWeight: "600",
        }}
      >
        <span
          style={{
            marginLeft: "1.5vw",
            width: "5vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          2
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          Quiz 2
        </span>
        <span
          style={{
            width: "14vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          04 Sep, 2023
        </span>
        <span
          style={{
            width: "10vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          2000
        </span>
        <span
          style={{
            marginLeft: "1vw",
            width: "7vw",
            display: "inline-block",
            textAlign: "center",
          }}
        >
          <img src={editIcon} alt="editIcon" />
          <span style={{ marginLeft: "0.5vw" }}>
            <img src={deleteIcon} alt="deleteIcon" />
          </span>
          <span style={{ marginLeft: "0.2vw" }}>
            <img src={shareIcon} alt="shareIcon" />
          </span>
        </span>
        <span
          style={{
            width: "14vw",
            textAlign: "center",
            display: "inline-block",
            marginLeft: "1vw",
            textDecoration: "underline",
          }}
        >
          Question Wise Analysis
        </span>
      </p>

      <p
        style={{
          textAlign: "right",
          color: "#474444",
          marginRight: "5vw",
          marginTop: "30vh",
        }}
      >
        {"{more quiz can be added}"}{" "}
      </p>
    </div>
  );
}

export default Analytics;
